import React from "react";

const Footer = () => {
  return (
    <div className="container footer-container">

        <div className="footer">
          <div className="row">
            <div className="footer-col col1 bold"> Coded with PERN stack</div>
            <div className="footer-col col1 bold text-center"> Copyright &copy; CourseRate</div>
            <div className="footer-col col1 bold text-right"> Hello</div>
          </div>
        </div>

    </div>
  );
};

export default Footer;
